import './App.css';
import getTitle from './ServerCall';
import axios from "axios";
const baseURL = "http://localhost:3000/";
function App() {
  var returned;
  axios.get(baseURL).then((response) => {
          console.log(JSON.stringify(response.data.message));
          returned  = response.data.message;
      });


  return (
    <div className="App">
      <header className="App-header">
        <button onClick={getTitle}>{returned}</button>
        <h1>{returned}</h1>
      </header>

    </div>
  );
}

export default App;
